import React, { useState } from 'react';

function App() {
  const [image, setImage] = useState(null);
  const [imagePreviews, setImagePreviews] = useState([]);
  const [focalPoints, setFocalPoints] = useState([
    { x: 1000, y: 1000 },
    { x: 3000, y: 2000 },
    { x: 5000, y: 3000 }
  ]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleImageUpload = async (e) => {
    const file = e.target.files[0];
    setImage(file);

    // Create preview of the three sections
    const img = new Image();
    img.onload = () => {
      const canvas = document.createElement('canvas');
      const ctx = canvas.getContext('2d');
      
      // Set canvas size to match image
      canvas.width = img.width;
      canvas.height = img.height;
      
      // Draw the full image
      ctx.drawImage(img, 0, 0);
      
      // Calculate section width
      const sectionWidth = Math.floor(img.width / 3);
      
      // Create three preview sections
      const previews = [];
      for (let i = 0; i < 3; i++) {
        const sectionCanvas = document.createElement('canvas');
        sectionCanvas.width = sectionWidth;
        sectionCanvas.height = img.height;
        const sectionCtx = sectionCanvas.getContext('2d');
        
        // Draw section
        sectionCtx.drawImage(
          img,
          i * sectionWidth, 0, sectionWidth, img.height,  // Source rectangle
          0, 0, sectionWidth, img.height                  // Destination rectangle
        );
        
        previews.push(sectionCanvas.toDataURL());
      }
      
      setImagePreviews(previews);
    };
    
    img.src = URL.createObjectURL(file);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    setLoading(true);

    console.log('Submitting image:', image);
    console.log('Focal points:', focalPoints);

    try {
      const formData = new FormData();
      formData.append('image', image);
      formData.append('focalPoints', JSON.stringify(focalPoints));

      for (let pair of formData.entries()) {
        console.log(pair[0], pair[1]);
      }

      const response = await fetch('http://localhost:5000/api/process_image', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        const errorData = await response.json();
        throw new Error(errorData.error || 'Failed to process image');
      }

      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'wiggle.mp4';
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
      window.URL.revokeObjectURL(url);

    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>WiggleLens Image Processor</h1>
      
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            Upload Image (6024x4024):
            <input 
              type="file" 
              accept="image/*" 
              onChange={handleImageUpload}
              required 
            />
          </label>
        </div>

        {imagePreviews.length > 0 && (
          <div style={{ marginTop: '20px' }}>
            <h3>Image Sections:</h3>
            <div style={{ display: 'flex', gap: '10px', overflowX: 'auto' }}>
              {imagePreviews.map((preview, index) => (
                <div key={index} style={{ flex: '0 0 auto' }}>
                  <h4>Section {index + 1}</h4>
                  <img 
                    src={preview} 
                    alt={`Section ${index + 1}`} 
                    style={{ 
                      maxWidth: '300px', 
                      maxHeight: '400px',
                      objectFit: 'contain',
                      border: '1px solid #ccc'
                    }} 
                  />
                </div>
              ))}
            </div>
          </div>
        )}

        <button 
          type="submit" 
          disabled={!image || loading}
          style={{ marginTop: '20px' }}
        >
          {loading ? 'Processing...' : 'Create Wiggle'}
        </button>
      </form>

      {error && (
        <div style={{ color: 'red', marginTop: '20px' }}>
          Error: {error}
        </div>
      )}
    </div>
  );
}

export default App;
